Maybe isolate the code that modifies the ONNX from the code that embeds it into the Leela proto?

I can see two ways of doing this.
1. Either have a function that modifies ONNX first:
```cpp
std::string MaybeUpdateONNX(std::string input) {
   if (!fix50rule && !fixwdl) return input;
   pblczero::ModelProto model;
   model.ParseFromString(input);
   // Do the fixes.
   return model.OutputToString();
}

onnx->set_model(MaybeUpdateONNX(ReadFileToString(dict.Get<std::string>(kInputFilenameId))));
```

2. Or embed first and then postprocess:
```cpp
void MaybeUpdateWeights(pblczero::Net* out_weights) {
  if (!fix50rule && !fixwdl) return;
  // Otherwise parse from out_weights.mutable_onnx_model()->onnx(), fix and overwrite.
}

// And call only in the very end:
MaybeUpdateWeights(&out_weights);
WriteStringToGzFile(dict.Get<std::string>(kOutputFilenameId),
                      out_weights.OutputAsString());
```

Strictly speaking, fixing ONNX is not really part of the onnx to leela conversion (it may be a separate command or even tool), but I agree it's more convenient here. Do you think it would make sense also to have another command just for fixing the network? (maybe potentially not only ONNX).
